  name: "RTKLib POS"
  code: "rtklib"
  file-type: ColumnsFixedWidth
  match-regex: "^.*RTKPOST-QT ver.+ Emlid b33$"
  file-format:
    comment-prefix: '%'
    decimal-separator: '.'
    column-lengths: [10, 1, 12]
  columns:     
    latitude:
      index: 1
    longitude:
      index: 2
    timestamp:
      index: 0